                                evaluate : function(point,threshold){ 
                                  return point[2] > threshold; 
                                }
                              },
                              {
                                threshold: -7, 
                                color: '#00ffff', 
                                evaluate : function(point,threshold){ 
                                  return point[2] > threshold; 
                                }
                              },
                              {
                                threshold: -11, 
                                color: '#00a2ff', 
                                evaluate : function(point,threshold){ 
                                  return point[2] > threshold; 
                                }
                              }
                              ,
                              {
                                threshold: -25, 
                                color: '#0000ff', 
                                evaluate : function(point,threshold){ 
                                  return point[2] > threshold; 
                                }
                              }
                          ],label: "Altura (m)" }
            }

            // hard-code color indices to prevent them from shifting as
            // countries are turned on/off
            var i = 0;
            $.each(datasets, function(key, val) {
                val.color = i;
                ++i;
            });
            
            // insert checkboxes 
            var choiceContainer = $("#choices");
            $.each(datasets, function(key, val) {
                choiceContainer.append('<label class="checkbox"><input type="checkbox" name="' + key +
                                       '" id="id' + key + '">' +
                                       val.label + '</label>');
            });

            //$("#idAltura").attr('checked', true);

            plotAccordingToChoices();
          
            function plotAccordingToChoices() {

              var data = [];

              data.push(datasets["Altura"]);

              if (data.length > 0)              
                  plot = $.plot($("#placeholder"),
                    data,
                     {
                        series: {
                            lines: { show: true }
                        },
                        crosshair: { mode: "x" },
                        selection: { mode: "x" },
                        grid: { hoverable: true, autoHighlight: false },
                        xaxis:{color:'#FFF'},                 
                        yaxes: [ 
                        {color:'#FFF', min: 853 }
                        ],
                        legend: { show:false },
                        colors: [ '#00ff00', '#0000FF']
                      });
            }

            plotAccordingToChoices();
            
            $("#placeholder").bind("plothover",  function (event, pos, item) {

              $('#infocontainer').show();

              if(index_fin==null && index_ini==null){
                var index = km.indexOf(pos.x.toFixed(1));
                //alert(JSON.stringify(pos.x.toFixed(1), null, 4)); 
                //alert(lat[index]+","+lon[index]);
                if(index!=-1){
                  pto = new google.maps.LatLng(lat[index],lon[index]);
                  map.panTo(pto);

                  $("#selection").html("Distancia: "+km[index]+
                      "km<br>Desnivel acum.: "+acum[index]+
                      "m<br>Altura: "+ele[index]+
                      "m<br>Pendiente: "+pend[index]+
                      "%");
                  }
                }
                
                marker.setVisible(true);
                
                marker.setPosition(pto);

            });

            var index_ini = null;
            var index_fin = null;

            $("#placeholder").bind("plotselected", function(event, ranges) {
              
              from = ranges.xaxis.from.toFixed(1);
              to = ranges.xaxis.to.toFixed(1);

              index_ini = km.indexOf(from);
              index_fin = km.indexOf(to);

              cont = 0;

              while(index_ini==-1 && cont<5){
                from = (parseFloat(from)*10+1)/10;
                index_ini = km.indexOf(""+from);
                cont++;
              }

              if(cont==5){
                while(index_fin==-1){
                  from = (parseFloat(from)*10-1)/10;
                  index_ini = km.indexOf(""+from);
                }  
              }

              cont = 0;

              while(index_fin==-1 && cont<5){
                to = (parseFloat(to)*10+1)/10;
                index_fin = km.indexOf(""+to);
                cont++;
              }

              if(cont==5){
                while(index_fin==-1){
                  to = (parseFloat(to)*10-1)/10;
                  index_fin = km.indexOf(""+to);
                }  
              }
              
              
              distancia = ranges.xaxis.to.toFixed(1) - ranges.xaxis.from.toFixed(1);

              //desnivel
              desnivel = ele[index_fin] - ele[index_ini];
              //acumulado
              acumulado = acum[index_fin] - acum[index_ini];
              //pendiente media
              pend_med = (desnivel)*100/(distancia*1000);
              
              $("#selection").html(
                ranges.xaxis.from.toFixed(1) + " km a " + ranges.xaxis.to.toFixed(1) + " km"
                + "<br>Distancia: " + distancia.toFixed(1) + " km"
                + "<br>Desnivel: " + desnivel.toFixed(0) + " m"
                + "<br>Acumulado: " + acumulado.toFixed(0) + " m"
                + "<br>Pend. media: " + pend_med.toFixed(1) + "%"
              );

              
            });

            $("#placeholder").bind("mouseleave",function(e){
               $('#infocontainer').hide();
            })

            $("#placeholder").bind("plotunselected", function (event) {
                $("#selection").text("");
                index_ini = null;
                index_fin = null;
            });

            $("#clearSelection").click(function () {
                plot.clearSelection();
            });

            
      });

      $('#placeholder').mouseout(function() {
        marker.setVisible(false);
        //map.setZoom(10);
      });

      $('#scroll_event').mousewheel(function(event, delta, deltaX, deltaY) {
        if (delta > 0)
        map.setZoom(map.getZoom()+1);
        else if (delta < 0)
        map.setZoom(map.getZoom()-1);

        return false;
      });

    $(document).ready(function() {
        initialize();
      });
</script>
